table<-read.table(text=input, header=T)
table2<-table[,c('SampleID', 'Sex_Diet', 'Week', 'Weight_Gain')]
table3<-melt(table2, measure.vars = 'Weight_Gain')
head(table3)

table4<-ddply(table3, .(Sex_Diet, Week), summarize, Mean=mean(value), SD=sd(value))
table4$lower = table4$Mean + table4$SD
table4$upper = table4$Mean - table4$SD

pd <- position_dodge(width = 0.5) # move them .2 to the left and right

gbase  = ggplot(table4, aes(y=Mean, colour=Sex_Diet)) + 
  geom_errorbar(aes(ymin=lower, ymax=upper), width=4, position=pd) +
  geom_point(position=pd, size=3) + geom_line(position=pd) 
print(gline + aes(x=Week))

p<-ggplot(table4, aes(y=Mean, ymin=lower, ymax=upper, colour=Sex_Diet)) +
  geom_point(position=pd, size=3) + geom_line(position=pd)  +
  geom_errorbar(position=pd, aes(width=2), show.legend=FALSE) +
  theme_bw() +
  theme(text = element_text(size = 10),
        panel.grid.major = element_blank(),panel.grid.minor = element_blank(),
        axis.line = element_line(),panel.border =  element_blank())+
  scale_y_continuous(limits=c(0,21), expand = c(0, 0)) + 
  scale_x_continuous(limits=c(0,12), expand = c(0, 0), breaks=c(0,1, 3, 5, 7, 9, 11))
print(p + aes(x=Week))


as.numeric(as.character(table4$Week))





